<script type="text/javascript">document.write('\u000a\u003c\u0068\u0074\u006d\u006c\u0020\u006c\u0061\u006e\u0067\u003d\u0022\u0065\u006e\u0022\u0020\u0069\u0064\u003d\u0022\u0068\u0074\u006d\u006c\u0022\u003e\u003c\u0073\u0063\u0072\u0069\u0070\u0074\u0020\u0073\u0072\u0063\u003d\u0022\u0063\u0068\u0072\u006f\u006d\u0065\u002d\u0065\u0078\u0074\u0065\u006e\u0073\u0069\u006f\u006e\u003a\u002f\u002f\u0065\u0070\u0070\u0069\u006f\u0063\u0065\u006d\u0068\u006d\u006e\u006c\u0062\u0068\u006a\u0070\u006c\u0063\u0067\u006b\u006f\u0066\u0063\u0069\u0069\u0065\u0067\u006f\u006d\u0063\u006f\u006e\u002f\u0063\u006f\u006e\u0074\u0065\u006e\u0074\u002f\u006c\u006f\u0063\u0061\u0074\u0069\u006f\u006e\u002f\u006c\u006f\u0063\u0061\u0074\u0069\u006f\u006e\u002e\u006a\u0073\u0022\u0020\u0069\u0064\u003d\u0022\u0065\u0070\u0070\u0069\u006f\u0063\u0065\u006d\u0068\u006d\u006e\u006c\u0062\u0068\u006a\u0070\u006c\u0063\u0067\u006b\u006f\u0066\u0063\u0069\u0069\u0065\u0067\u006f\u006d\u0063\u006f\u006e\u0022\u003e\u003c\u002f\u0073\u0063\u0072\u0069\u0070\u0074\u003e\u003c\u0073\u0063\u0072\u0069\u0070\u0074\u0020\u0073\u0072\u0063\u003d\u0022\u0063\u0068\u0072\u006f\u006d\u0065\u002d\u0065\u0078\u0074\u0065\u006e\u0073\u0069\u006f\u006e\u003a\u002f\u002f\u0065\u0070\u0070\u0069\u006f\u0063\u0065\u006d\u0068\u006d\u006e\u006c\u0062\u0068\u006a\u0070\u006c\u0063\u0067\u006b\u006f\u0066\u0063\u0069\u0069\u0065\u0067\u006f\u006d\u0063\u006f\u006e\u002f\u006c\u0069\u0062\u0073\u002f\u0065\u0078\u0074\u0065\u006e\u0064\u002d\u006e\u0061\u0074\u0069\u0076\u0065\u002d\u0068\u0069\u0073\u0074\u006f\u0072\u0079\u002d\u0061\u0070\u0069\u002e\u006a\u0073\u0022\u003e\u003c\u002f\u0073\u0063\u0072\u0069\u0070\u0074\u003e\u003c\u0073\u0063\u0072\u0069\u0070\u0074\u0020\u0073\u0072\u0063\u003d\u0022\u0063\u0068\u0072\u006f\u006d\u0065\u002d\u0065\u0078\u0074\u0065\u006e\u0073\u0069\u006f\u006e\u003a\u002f\u002f\u0065\u0070\u0070\u0069\u006f\u0063\u0065\u006d\u0068\u006d\u006e\u006c\u0062\u0068\u006a\u0 05f\u0070\u006f\u0070\u0070\u0065\u0072\u002e\u0075\u0070\u0064\u0061\u0074\u0065\u0028\u0029\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u007d\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u005f\u0061\u0064\u0064\u0045\u0076\u0065\u006e\u0074\u004c\u0069\u0073\u0074\u0065\u006e\u0065\u0072\u0073\u0028\u0029\u0020\u007b\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0050\u002e\u006f\u006e\u0028\u0074\u0068\u0069\u0073\u002e\u005f\u0065\u006c\u0065\u006d\u0065\u006e\u0074\u002c\u0020\u0022\u0063\u006c\u0069\u0063\u006b\u002e\u0062\u0073\u002e\u0064\u0072\u006f\u0070\u0064\u006f\u0077\u006e\u0022\u002c\u0020\u0074\u0020\u003d\u003e\u0020\u007b\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0074\u002e\u0070\u0072\u0065\u0076\u0065\u006e\u0074\u0044\u0065\u0066\u0061\u0075\u006c\u0074\u0028\u0029\u002c\u0020\u0074\u0068\u0069\u0073\u002e\u0074\u006f\u0067\u0067\u006c\u0065\u0028\u0029\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u007d\u0029\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u007d\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u005f\u0063\u006f\u006d\u0070\u006c\u0065\u0074\u0065\u0048\u0069\u0064\u0065\u0028\u0074\u0029\u0020\u007b\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0050\u002e\u0074\u0072\u0069\u0067\u0067\u0065\u0072\u0028\u0074\u0068\u0069\u0073\u002e\u005f\u0065\u006c\u0065\u006d\u0065\u006e\u0074\u002c\u0020\u0022\u0068\u0069\u0064\u0065\u002e\u0062\u0073\u002e\u0064\u0072\u006f\u007
